import React from "react";
import { DBConfig } from "./DBConfig";
// import { initDB } from "react-indexed-db";
import { IndexedDB } from "react-indexed-db";
import Groups from "./Groups";

initDB(DBConfig);

export default function App() {
  return (
    <IndexedDB {...DBConfig}>
      <Groups />
    </IndexedDB>
  );
}
